import React from "react";
import '../css/QnAbox.css';
function QnAbox() {
    return (
    <div className= "QnAbox">
        <div className = "box_info">
            <Avatar />
            <h5> Username </h5>
        </div>
        <div className = "box_QnA">
            <p>What's your question?</p>
        </div>
    </div>
    );
}
export default QnAbox
